Lindsey Adams Buckingham (born October 3, 1949) is an American guitarist, singer, composer and producer, most notable for being the guitarist and male lead singer of the musical group Fleetwood Mac from 1975 to 1987, and 1997 to present day. Aside from his tenure with Fleetwood Mac, Buckingham has also released six solo albums and three live albums. As a member of Fleetwood Mac, he was inducted into the Rock and Roll Hall of Fame in 1998. In 2011, Buckingham was ranked 100th in Rolling Stone magazine's 2011 list of &quot;The 100 Greatest Guitarists of All Time&quot;.[1] In Fleetwood Mac's heyday, Buckingham was known for his fingerpicking guitar style and wide vocal range as well as the famous (sometimes tense) chemistry between himself and former girlfriend and bandmate Stevie Nicks. 



Seeds We Sow 2011


Seeds We Sow is a solo album by American musician and Fleetwood Mac vocalist/guitarist Lindsey Buckingham, released on September 6, 2011. It is Buckingham's sixth solo album, and his first to be self-released.[7]

The album entered the Billboard 200 in the week of September 24, 2011.[8] By reaching number 45, Seeds We Sow ties with 1984's Go Insane as Buckingham's second successful album after his 1981 debut Law and Order. Additionally, it also reached number 6 on the Billboard Rock Album Chart and number 5 on the Billboard Independent Albums Chart. The title track was also released as a single but failed to chart.

